import React from "react";

export default function Post() {
  return (
    <div>
      <div className="container">
        <div className="row">
          <h3 className="text-muted pt-5">Fill in the details to add post</h3>
          <hr className="pt-5" />
          <div className="col-sm-2"></div>
        </div>
      </div>
    </div>
  );
}
